import React from 'react';
import ReactDOM from 'react-dom/client';

function show()
{
  return <h1>Hi shahzaib!</h1>

}
function button()
{
  return <button type = "button">Click me!</button>
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(button());
root.append(show());
